import { Component } from "react";
import axios from "axios";
import "./Styles/styles.css";

class Main extends Component{

    constructor(){
        super()
        this.getAllContacts = this.getAllContacts.bind(this);
        this.state = {
            contacts: []
        }
    }

    getAllContacts(){
        // axios.get('http://localhost:8080/contacts').then(response => {
        //     let elementsArr = [];
        //     response.data.forEach((contactObj, index) => {
        //         elementsArr.push(
        //             <div key = { index }>
        //                 {contactObj.name}
        //             </div>
        //         );
        //     });
        //     this.setState({contacts: elementsArr})});

        // Make an AJAX request using the XMLHttpRequest object
        var xhr = new XMLHttpRequest();

        // Set the request URL and method
        xhr.open('GET', 'http://localhost:8080/contacts', true);

        // Define the callback function
        xhr.onload = function() {
        // Check the response status code
        if (xhr.status === 200) {
            // Parse the JSON response
            var data = JSON.parse(xhr.responseText);

            // Do something with the data
            console.log(xhr.responseText)
            console.log(data);
        }
        };

        // Send the request
        xhr.send();

    }

    componentDidMount() {
        this.getAllContacts();
    }

    render(){
        return <div>
                { this.state.contacts }
            </div>
    }

}

export default Main;
